import React from "react";
import ReactDOM from "react-dom";
import TodoList from "./components/TodoList";
import TodoForm from "./components/TodoForm";
import SearchBar from "./components/SearchBar";

const App = () => {
  return (
    <div>
      <TodoList />
      <TodoForm />
      <SearchBar />
    </div>
  );
};

export default App;
